import React from "react";
import { connect } from "react-redux";
import { getNews } from "../actions";

const Login = (props) => {
  return (
    <div>
      <button onClick={() => props.getNews()}>Login</button>
    </div>
  );
};

export default connect(null, { getNews })(Login);
